// is not html but jsx(javascript extension)
import Header from "./components/Header";
import Tasks from "./components/Tasks";
import React from "react";

function App() {
  const [tasks, setTasks] = useState([
    {
      id: 1,
      text: "Doc",
      day: "9.10.2010",
      reminder: true,
    },
    {
      id: 2,
      text: "Dog",
      day: "9.10.2010",
      reminder: true,
    },
    {
      id: 3,
      text: "Mom",
      day: "9.10.2010",
      reminder: false,
    },
  ]);

  return (
    <div className="container">
      <Header title="Add"></Header>
      <Tasks task={tasks} />
    </div>
  );
}

export default App;
